import React, { Component } from "react";


function Table(props) {

    return (
      <div>
        <button
          type="button"
          className="btn btn-warning"
          onClick={() => window.open(props.link, "_blank")}
        >
          See Repo
        </button>
      </div>
    );
  }

  export default Table
